description:
Welcome to Gem Hunt – Latvia’s largest online clothing advertisement portal!

Buy and sell on Andelemandele – online site where you can sell your personal wardrobe:
clothes, shoes, accessories, bags, everything for kids, household goods, etc.

On Andelemandele, you can:

Sell:
· Your personal wardrobe, household goods, books, electronics and even cars;
· Post your ad quickly and easily;
· The app will keep you updated on incoming Gem applications and messages from potential
buyers;
· Create your personal virtual wardrobe and collect fans-buyers for your wardrobe;
· The higher the quality of the ads, the more likely they are to be added to the Supergems
that appear at the top of the page for buyers.

Buy:
· Choose your purchases from over 300,000 active ads and 5,000 brands;
· The average Gem price is 70-90% lower than the respective shelf price;
· Use the handy search option to search by category, size, colour, material, brand, location;
· Follow your favourites’ wardrobes, sellers, brands, get notifications about the latest items
added by your favourite users and don’t miss your Supergem;
· In the forum section you can make joint orders, announce a search for a specific item,
discuss things with other Gem hunters.

We wish you a successful Gem Hunt!
